    <div className="main">
      <aside id="notes">
        <div id="notes-menu">
          <div id="notes-title"><h1>Notes </h1></div>
          <div id="add"><button>+</button></div>
        </div>
        <div>
          <p>contents</p>
        </div>
      </aside>
      <div id="main-container">
        <div id="main-menu"><h2>Overview</h2></div>
        <ReactQuill theme="snow" value={value} onChange={setValue} />;

        <div><p>contents</p></div>
      </div>
    </div>
  );
}

export default Main;
